        <FlatList
          data={users}
          renderItem={(u) => <User user={u} />}
          keyExtractor={(item) => item.id}
        />
      <IconButton>
        icon="account-details"
        size={28}
        color="#941a1d"
        activeOpacity={0.5}
        onPress={() => navigation.navigate("Details", u)}
        </IconButton>
      <IconButton>
        icon="square-edit-outline"
        size={28}
        color="#941a1d"
        activeOpacity={0.5}
        onPress={() => navigation.navigate("Edit", u)}
        </IconButton>
      <IconButton>
        icon="delete"
        size={28}
        color="#941a1d"
        activeOpacity={0.5}
        onPress={() => navigation.navigate("Delete", u)}
        </IconButton>
      </View>

      <FAB
        icon="plus"
        large="true"
        color="white"
        theme={{ colors: { accent: "#941a1d" } }}
        style={{
          position: "absolute",
          margin: 16,
          right: 10,
          bottom: 10  ,
        }}
        onPress={() => navigation.navigate("Create")}
      ></FAB>
    </View>
  );
}
